(2, 1, '2016-05-10 03:48:21', '2016-05-10 03:48:21', '<!-- wp:image {\"id\":8} -->\n<figure class=\"wp-block-image\"><img src=\"http://split-price.ru/wp-content/uploads/2019/08/split-1024x389.png\" alt=\"\" class=\"wp-image-8\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:heading {\"className\":\"h2__title\"} -->\n<h2 class=\"h2__title\">ПОДБОР, ПРОДАЖА, МОНТАЖ <em>СПЛИТ-СИСТЕМ</em></h2>\n<!-- /wp:heading -->', 'Главная страница', '', 'publish', 'closed', 'closed', '', 'front-page', '', '', '2019-09-02 12:14:38', '2019-09-02 12:14:38', '', 0, 'http://split-price.ru/?page_id=2', 1, 'page', '', 0),
(4, 1, '2019-08-28 13:27:45', '2019-08-28 13:27:45', 'This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://split-price.ru/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!', 'Sample Page', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2019-08-28 13:27:45', '2019-08-28 13:27:45', '', 2, 'http://split-price.ru/?p=4', 0, 'revision', '', 0),
