(2370, 1, '2019-08-30 11:17:51', '2019-08-30 11:17:51', ' 															<p>AERONIK Серия SUPER (ASI-HS4/ASO-HS4 )</p><p>Сплит система Aeronik серии Super очень удобна в эксплуатации благодаря большому набору функционала. В комплекте с кондиционером идет пульт дистанционного управления с датчиком температуры, что позволяет более точно контролировать температуру рядом с пользователем.</p><p>Система очистки кондиционера Aeronik (Аероник) внесет свежесть, чистоту воздуха в Ваш уют. </p><p>Покупая кондиционер Аероник серии Супер в нашем интернет магазине, Вы получаете официальную гарантию на 3 года.</p>														', 'Серия SUPER on/of', '', 'trash', 'closed', 'open', '', 'seriya-super-on-of__trashed', '', '', '2019-08-30 11:34:49', '2019-08-30 11:34:49', '', 0, 'http://split-price.ru/aeronik/seriya-super-on-of/', 0, 'post', '', 0),
(2378, 1, '2019-08-30 11:17:51', '2019-08-30 11:17:51', ' 															<p>Сплит система AERONIK Серия LEGEND Инверторная</p><p>Инверторный кондиционер Aeronik серии Legend способен не только охладить воздух в вашем помещении , но и полноценно обогреть его при отрицательных температурах за окном.&nbsp;Инверторный компрессор сплит системы Aeronik серии Legend (ASI-IL1/ASO-IL1) позволит вам экономить на потреблении энергии даже при максимальной отдаче устройства.&nbsp;Данный тип кондиционеров обладает очень низким уровнем шума, минимальным потреблением электроэнергии и стабильной работой на обогрев при -15 градусах на улице.</p><p>Купить инверторный кондиционер Aeronik в Краснодаре можно в нашем магазине.</p>														', 'Серия Legend (Инвертор) inverter', '', 'trash', 'closed', 'open', '', 'seriya-legend-invertor-inverter__trashed', '', '', '2019-08-30 11:34:49', '2019-08-30 11:34:49', '', 0, 'http://split-price.ru/aeronik/seriya-legend-invertor-inverter/', 0, 'post', '', 0),
