(2936, 1, '2019-08-30 11:12:08', '2019-08-30 11:12:08', ' 															<p>AERONIK Серия SUPER (ASI-HS4/ASO-HS4 )</p><p>Сплит система Aeronik серии Super очень удобна в эксплуатации благодаря большому набору функционала. В комплекте с кондиционером идет пульт дистанционного управления с датчиком температуры, что позволяет более точно контролировать температуру рядом с пользователем.</p><p>Система очистки кондиционера Aeronik (Аероник) внесет свежесть, чистоту воздуха в Ваш уют. </p><p>Покупая кондиционер Аероник серии Супер в нашем интернет магазине, Вы получаете официальную гарантию на 3 года.</p>														', 'Серия SUPER on/of', '', 'inherit', 'closed', 'closed', '', '2370-revision-v1', '', '', '2019-08-30 11:12:08', '2019-08-30 11:12:08', '', 2370, 'http://split-price.ru/news/2370-revision-v1/', 0, 'revision', '', 0),
(2944, 1, '2019-08-30 11:12:08', '2019-08-30 11:12:08', ' 															<p>Сплит система AERONIK Серия LEGEND Инверторная</p><p>Инверторный кондиционер Aeronik серии Legend способен не только охладить воздух в вашем помещении , но и полноценно обогреть его при отрицательных температурах за окном.&nbsp;Инверторный компрессор сплит системы Aeronik серии Legend (ASI-IL1/ASO-IL1) позволит вам экономить на потреблении энергии даже при максимальной отдаче устройства.&nbsp;Данный тип кондиционеров обладает очень низким уровнем шума, минимальным потреблением электроэнергии и стабильной работой на обогрев при -15 градусах на улице.</p><p>Купить инверторный кондиционер Aeronik в Краснодаре можно в нашем магазине.</p>														', 'Серия Legend (Инвертор) inverter', '', 'inherit', 'closed', 'closed', '', '2378-revision-v1', '', '', '2019-08-30 11:12:08', '2019-08-30 11:12:08', '', 2378, 'http://split-price.ru/news/2378-revision-v1/', 0, 'revision', '', 0),
