(6515, 1, '2019-09-07 16:10:16', '2019-09-07 16:10:16', 'Благодаря накопленному за долгие годы опыту инженеры  создали классическую серию бытовых кондиционеров с комплектом оптимальных эксплуатационных характеристик - серию FTXP-L. Кондиционеры данной серии создадут в вашем доме совершенные климатические условия при минимальных энергозатратах и с высокой степенью экологичности. За счет использования фреона нового поколения марки R-32 улучшены показатели сезонной энергоэффективности и на 68% снижено вредное воздействие на окружающую среду (по сравнению с хладагентом R-410). Производство серии FTXP-L налажено на заводе в Чехии и соответствует высоким стандартам качества . Внутренний блок выполнен в классическом стиле, в корпусе белого глянцевого цвета. Такой блок удачно впишется в интерьер любого помещения, будь то офис или квартира. Благодаря низкому уровню шума (от 20 дБ) система не потревожит ваш сон и без ущерба в комфорте будет служить вам даже в спальне. За чистоту воздуха в помещении отвечают два фильтра, входящие в комплект: титано-апатитовый дезодорирующий фильтр и стандартный воздушный фильтр . Благодаря титано-апатитовому фильтру эффективно устраняются посторонние запахи, в том числе запах табачного дыма. Воздушный фильтр представляет собой мелкоячеистую сетку, которая задерживает частички пыли, шерсть животных, волосы и другие загрязнения, содержащиеся в воздухе. В серии FTXP-L воплощены все лучшие «наработки» предыдущих серий сплит-систем от : несколько режимов работы (ночной, экономичный, автоматический, режим поддержания комфортной температуры), авторестарт, автоперемещение заслонок-шторок для равномерного кондиционирования воздушных потоков, бесшумная работа, а в качестве дополнительной опции предусмотрено удаленное управление по Wi-Fi.  		 		 	', 'FTXP-L/RXP', '', 'publish', 'open', 'closed', '', 'ftxp-l-rxp', '', '', '2019-09-07 16:10:16', '2019-09-07 16:10:16', '', 0, 'http://split-price.ru/seria/ftxp-l-rxp/', 0, 'seria', '', 0),
