(6522, 1, '2019-09-07 16:10:16', '2019-09-07 16:10:16', 'Компания  представляет новый кондиционер  FTXG Emura с усовершенствованным дизайном внутреннего блока. Новый европейский дизайн кондиционера был разработан с учетом всех реалий и тенденций рынка. Корпус кондиционера очень тонкий по краям с небольшим утолщением по середине. Такой прием позволил создать один из самых тонких корпусов на рынке. Самый тихий кондиционер на рынке. За счет усовершенствований аэродинамики вентилятора кондиционера, а также новейшего инвертора уровень шума кондиционера был снижен до рекордных 19 Дб! Такой показатель на сегодняшний день является лучшим на рынке. Кроме того, 19 Дб практически не различимы для нашего слуха. Сравните, уровень шума стрелок настенных часов — около 30 Дб. Самый экономичный кондиционер. Кондиционер  FTXG Emura имеет самый высокий класс энергоэффективности. Компания  присвоила ему класс А+++. Стоит сказать, что данный класс не введен в общеевропейскую классификацию, но так как кондиционер намного превышает класс А++, было принято решение, присвоить ему уже сейчас класс А+++. Кроме того, кондиционер имеет двухзонный датчик движения «Умный глаз», который следит за перемещениями в комнате и в случае отсутствия движения переводит кондиционер в энергосберегающий режим. Датчик также обеспечивает наиболее комфортное распределение охлажденного воздуха, направляя его в сторону от людей. Высокая экономичность кондиционера стала возможна не только благодаря технологическим усовершенствованиям в аэродинамике и датчику «Умный глаз», но и благодаря новейшему инвертору, который обеспечивает минимальное потребление электроэнергии и самый низкий уровень шума. Очистка воздуха от всех загрязнений. Система фильтрации кондиционера не претерпела изменений в сравнении с предыдущей серией  FTXG EMURA. Новый кондиционер имеет все те же проверенные временем фильтры — против пыли и всех частиц размером меньше 0,3 микрон, а также титан-апатитовый фотокаталитический фильтр. Все вместе фильтры обеспечивают очистку от: Пыли и шерсти домашних животных Пылевых клещей, сапрофитов Бактерий и вирусов Неприятных запахов и табачного дыма Фильтры легко чистятся и восстанавливают свои дезинфицирующий свойства под действием солнечных лучей.  		 		 	', 'FTXG-L/RXG', '', 'publish', 'open', 'closed', '', 'ftxg-l-rxg', '', '', '2019-09-07 16:10:16', '2019-09-07 16:10:16', '', 0, 'http://split-price.ru/seria/ftxg-l-rxg/', 0, 'seria', '', 0),
