(6533, 1, '2019-09-07 16:10:16', '2019-09-07 16:10:16', 'Сплит-система  серии FTXM-M — это современный прибор, работающий на озонобезопасном и энергоэффективном хладагенте R-32. Данный хладагент представляет собой однокомпонентное вещество, легко поддающееся повторной переработке. Для удобства пользователя сплит-система управляется пультом дистанционного управления. Опционально можно приобрести онлайн контроллер для управления при помощи компьютера, планшета или смартфона. Многоступенчатая очистка воздуха очищает входящий поток воздуха и фильтрует воздухот пыли и пыльцы. Фотокаталитический фильтр уничтожает запахи. На заключительном этапе Flash Streamer уничтожает любые возможные остатки вредных химических веществ, вирусов и плесени. Данный прибор обладает богатым функционалом. На выбор пользователя предлагается несколько режимов работы, управление потоком воздуха, таймер для автоматизации работы прибора. Двухзонный датчик Intelligent Eye определяет, в какой части помещения находятся люди, и направляет поток воздуха в сторону от них. Если они находятся в обеих зонах, то воздух будет направляться вертикально вниз при нагреве, вдоль потолка — при охлаждении. При отсутствии людей кондиционер будет переведен в энергосберегающий режим. Практически бесшумная работа прибора позволяет устанавливать его в комнатах для отдыха и сна. Режим комфортного воздухораспределения обеспечивает наилучшую циркуляцию воздуха в помещении за счет согласованных качаний заслонок и жалюзи, создавая при этом наиболее благоприятный микроклимат в помещении.  		Что такое инвертор? 		 	', 'FTXM/RXM', '', 'publish', 'open', 'closed', '', 'ftxm-rxm', '', '', '2019-09-07 16:10:16', '2019-09-07 16:10:16', '', 0, 'http://split-price.ru/seria/ftxm-rxm/', 0, 'seria', '', 0),
