(6541, 1, '2019-09-07 16:10:17', '2019-09-07 16:10:17', 'Кондиционер  FTXJ «Emura» - это новая флагманская модель в линейке  с уникальным изысканным дизайном внутреннего блока. В новой серии производитель улучшил ряд характеристик. Кондиционер работает на новом озонобезопасном и более экономичном фреоне R32. Данная модификация фреона позволяет снизить расходы на электроэнергию. Помимо нового фреона, кондиционер получил несколько улучшений. Кондиционер имеет новую систему очистки воздуха, которая отлично справляется со всеми загрязнениями, в том числе и с аллергенами. Новый фильтр задерживает все частицы, вызывающие аллергию - пыльцу растений и деревьев. Кондиционер является продолжением дизайнерской линейки  «Emura». Данная линейка сочетает в себе все преимущества премиального кондиционера , а также имеет широкий функционал и богатый выбор функций. При проектировании данного кондиционера инженеры  уделили много внимания дизайну внутреннего блока. Европейский дизайн кондиционера был разработан с учетом всех реалий и тенденций рынка. Корпус кондиционера очень тонкий по краям с небольшим утолщением по середине. Такой прием позволил создать один из самых тонких корпусов на рынке. Самый тихий кондиционер . Данная серия кондиционеров  по праву считается одной из самых тихих в линейке. Уровень шума внутреннего блока составляет всего 19 Дб при работе в ночном режиме и на малых оборотах. Такой уровень шума практически не слышим для нашего слуха. Для сравнения уровень шума стрелок настенных часов составляет 30 Дб. Самый экономичный кондиционер Кондиционер  FTXJ \"Emura\" имеет самый высокий класс энергоэффективности. Компания  присвоила ему класс А+++. Стоит сказать, что данный класс не введен в общеевропейскую классификацию, но так как кондиционер намного превышает класс А++, было принято решение, присвоить ему уже сейчас класс А+++. Кроме того, кондиционер имеет двухзонный датчик движения «Умный глаз», который следит за перемещениями людей в комнате и в случае отсутствия движения переводит кондиционер в энергосберегающий режим. Датчик также обеспечивает наиболее комфортное распределение охлажденного воздуха, направляя его в сторону от людей. Высокая экономичность кондиционера стала возможна не только благодаря технологическим усовершенствованиям в аэродинамике и датчику «Умный глаз», но и благодаря новейшему инвертору, который обеспечивает минимальное потребление электроэнергии и самый низкий уровень шума. Очистка воздуха от всех известных загрязнений Система фильтрации воздуха кондиционера  FTXJ «Emura» чистит воздух от всех известных загрязнений воздуха. Кондиционер получил два новых антиаллергенных фильтра с ионами серебра. Данные фильтры надежно нейтрализуют все частицы, вызывающие аллергию у человека - пыльцу растений и деревьев. Кроме того, проверенный временем фотокалитический фильтр нейтрализует вирусы, бактерии и неприятные запахи.  		Что такое инвертор? 		 	', 'FTXJ/RXJ', '', 'publish', 'open', 'closed', '', 'ftxj-rxj', '', '', '2019-09-07 16:10:17', '2019-09-07 16:10:17', '', 0, 'http://split-price.ru/seria/ftxj-rxj/', 0, 'seria', '', 0),
