(6547, 1, '2019-09-07 16:10:17', '2019-09-07 16:10:17', 'Новый кондиционер  FTXZ Ururu Sarara — это обновленная серия с новейшими функциями и усовершенствованным дизайном внутреннего блока. Кондиционер работает на новом фреоне R32, который имеет лучшую энергоэффективность среди конкурентов и экономит электроэнергию. Новые функции кондиционера: Автоматическая очистка фильтров (в кондиционере установлен отсек, куда собираются все загрязнения) Трехзонный датчик движения «Умный глаз» Новый дизайн внутреннего блока и новый экономичный фреон Переработанный пульт управления с ночной подсветкой Кондиционер  FTXZ имеет лучший показатель энергоэффетивности A+++ - такой классификации еще нет в стандартах Евросоюза, но «Дайкин» уже сейчас вводит данный стандарт, так как кондиционер имеет феноменальные показатели по экономичности. Это лучший класс и самая высокая экономия электроэенeргии среди всех конкурентов. Функции кондиционера  FTXZ Ururu Sarara Данный кондиционер сохранил функции предыдущей модели — увлажнения и притока свежего воздуха с улицы. Все уникальные функции кондиционера  FTXR были перенесены в новую модель. Кондиционер самостоятельно увлажняет воздух при помощи программного осушения воздуха с улицы, забирая необходимое количество влаги и увлажняя комнатный воздух до необходимого уровня. Кроме того, кондиционер обеспечивает приток свежего воздуха с улицы по специальному гофрированному шлангу. Воздух предварительно чистится в наружом блоке и поставляется в необходимом объеме в дом. Система очистки воздуха Система очистки воздуха кондиционера  FTXZ Ururu Sarara сохранила все ключевые элементы и фильтры из предыдущей модели и представляет собой уникальную технологию по очистке воздуха от всех известных загрязнений — это: Пыль и шерсть домашних животных Пылевые клещи и другие микроорганизмы Неприятные запахи, табачный дым Бактерии и вирусы Вредные химические вещества — толуол, ксилол, формальдегиды Кроме того, кондиционер самостоятельно собирает все загрязнения в специальный отсек, чем увеличивает мощность воздушного потока. За счет этой функции экономится еще около 25 процентов электроэнергии. Трехзонный датчик движения «Умный глаз» Новый датчик движения «Умный глаз» следит сразу за тремя зонами помещения и перемещениями людей в комнате и активирует наиболее комфортный режим работы кондиционера. В случае, если людей в помещении нет, то кондиционер переходит в энергосберегающий режим  		Что такое инвертор? 		 	', 'FTXZ-N/RXZ (Ururu Sarara)', '', 'publish', 'open', 'closed', '', 'ftxz-n-rxz-ururu-sarara', '', '', '2019-09-07 16:10:17', '2019-09-07 16:10:17', '', 0, 'http://split-price.ru/seria/ftxz-n-rxz-ururu-sarara/', 0, 'seria', '', 0),
