(6551, 1, '2019-09-07 16:10:17', '2019-09-07 16:10:17', 'Кондиционер  FTXK-AW(S) \"MIYORA\" - это новая серия от компании , которая дополняет дизайнерские модели FTXG Emura. Новый дизайн был разработан европейским бюро  под пристальным вниманием к деталям внутреннего блока. В переводе с японского \"MIYORA\" означает \"красивое и давать лучшее\", именно эти два ключевых качества сочетаются в данной серии - уникальный дизайн с оптимальными характеристиками. В кондиционерах удачно сочетается уникальный дизайн с широким набором функций. Кондиционер получил более плавные черты, очень качественный пластик и два цвета внутреннего блока - белоснежно белый и серебристый «под алюминий». Одним из ключевых преимуществ  FTXK является низкий уровень шума - всего 21 Дб при работе в экономичном или ночном режиме. Это один из самых низких уровней шума для настенного кондиционера на российском рынке.  ставит и реализует самые высокие цели в области конечного комфорта пользователя, поэтому имеет в своей линейке сразу три серии с низким уровнем шума на рынке. \"Пульт кондиционера  \"Miyora\" имеет встроенную подсветку, которая позволяет с комфортом пользоваться кондиционером в ночное время суток.\" Кондиционер  FTXK не только стабильно поддерживает благоприятный микроклимат в доме, но и чистит воздух от большинства известных загрязнений воздуха - пыли, шерсти домашних животных, пылевых клещей, сапрофитов и некоторых других загрязнений.  FTXK-AWсочетает в себе сразу несколько ключевых преимуществ премиального сегмента , но имеет демократичную цену в сравнении с серией  Emura. Производство кондиционера налажено в Малайзии, что позволило снизить конечную цену для потребителя, не теряя в качестве материалов, сборки и комплектующих. Кондиционер очень экономичен, имеет эффективный и производительный компрессор с инверторным приводом. Класс сезонной энергоэффективности кондиционера А+ позволяет кондиционеру стабильно работать на протяжении всего сезона отопления или охлаждения.  		Что такое инвертор? 		 	', 'FTXK-AW(S)/RXK (MIYORA)', '', 'publish', 'open', 'closed', '', 'ftxk-aws-rxk-miyora', '', '', '2019-09-07 16:10:17', '2019-09-07 16:10:17', '', 0, 'http://split-price.ru/seria/ftxk-aws-rxk-miyora/', 0, 'seria', '', 0),
