(6560, 1, '2019-09-07 16:10:17', '2019-09-07 16:10:17', 'Эта линейка неинверторных устройств климат-контроля подойдет для небольших помещений, владельцы которых заинтересованы в покупке предельно надежной и предельно долговечной техники. Он включает в себя модели, которые рассчитаны на обслуживание помещений с площадью от 15 до 60 метров квадратных. Срок гарантии на такую технику составляет три года.  		 		 	', 'Vega', '', 'publish', 'open', 'closed', '', 'vega', '', '', '2019-09-07 16:10:17', '2019-09-07 16:10:17', '', 0, 'http://split-price.ru/seria/vega/', 0, 'seria', '', 0),
