(6564, 1, '2019-09-07 16:10:17', '2019-09-07 16:10:17', 'Бытовой кондиционер типа On/Off из серии Classic . Сплит система DU-07 оснащена качественным японским компрессором GMCC и дополнительной функцией защиты в виде 3 минутной задержкой на включение после возобновления подачи питания. Данная модель рассчитана на помещение до 20 кв.м.   Обеспечить надежную работу и эксплуатацию прибора можно с помощью системы защиты от перепадов напряжения в диапазоне от 185 до 255 V. Самоочистка внутреннего блока . Технология автоматической очистки внутреннего блока от влаги и пыли после выключения позволит эффективно осушить теплообменник и поддерживать чистоту для дальнейшей работы.     Управление кондиционером осуществляется через пульт ду со встроенным температурным датчиком. При активации интеллектуального режима I Feel температура в помещении будет установлена согласно данным, которые будет улавливать сенсор в месте нахождения пульта.  Режимы и функции  DU-07:    Энергоэффективность класса А  Тихий уровень шума от 24 дБа  Антибактериальный воздушный фильтр  Светодиодный дисплей на лицевой панели  Компактные размеры внутреннего блока с шириной от 19 см  Автоматический перезапуск системы при сбоях в энергосети  Функция самодиагностики неисправностей и ошибок работы  Дополнительная экономия до 80% в режиме ожидания  Режим быстрого охлаждения  Таймер на вкл./выкл.  Комфортный Сон  Огнебезопасный фреон R410A  		 		 	', 'Classic', '', 'publish', 'open', 'closed', '', 'classic', '', '', '2019-09-07 16:10:17', '2019-09-07 16:10:17', '', 0, 'http://split-price.ru/seria/classic/', 0, 'seria', '', 0),
