(6688, 1, '2019-09-07 16:10:20', '2019-09-07 16:10:20', ' (Роял Клима) RC-VT22HN представляет собой экономичную и тихую в работе модель настенного кондиционера, способного всего за полчаса создать в небольшом помещении комфортную атмосферу. Сплит-система работает как на охлаждение, так и на обогрев. К тому же, в этой модели предусмотрены режимы осушения и вентиляции без изменения температуры воздуха.      Особые преимущества настенных кондиционеров  VISTA:    Работают на охлаждение, обогрев, вентиляцию и осушение.  Энергоэффективность класса А  Низкое потребление электроэнергии  Японские технологии  Привлекательный дизайн внешнего блока  Оборудованы воздушным фильтром  Скрытый дисплей  Низкий уровень шума   Вертикальная и горизонтальная регулировка потока воздуха  Возможность изменять мощность воздушного потока  Автоматический режим  Режим Sleep  Режим Turbo  Функция таймера    Антикоррозийное покрытие теплообменников Blue Fin  Двустороннее подключение и отвод дренажа  Пульт ДУ  Долгий срок службы  Итальянская компания  предлагает серию настенных кондиционеров VISTA, которые отличаются высоким уровнем энерго эффективность и низкими шумовыми характеристиками. Также, особенностью данных сплит-систем является  универсальное подключение дренажной трубки – ее можно подключить как с правой стороны внутреннего блока, так и с левой, что значительно упрощает монтаж кондиционера.  		 		 	', 'Vista  new 2019', '', 'publish', 'open', 'closed', '', 'vista-new-2019', '', '', '2019-09-07 16:10:20', '2019-09-07 16:10:20', '', 0, 'http://split-price.ru/seria/vista-new-2019/', 0, 'seria', '', 0),
