(3, 3, 'category', '', 0, 2),
(4, 4, 'category', '', 0, 4),
(5, 5, 'category', '', 0, 3),
(68, 68, 'brands', 'Кондиционеры Aeronik одна из ведущих марок климатического оборудования на рынке России.', 0, 2),
(69, 69, 'brands', 'Сплит-системы торговой марки AUX имеют одни из самых высоких показателей энергоэффективности на рынке нашей страны.', 0, 9),
(70, 70, 'brands', 'Современные сплит-системы Ballu, техника на высшем уровне!', 0, 7),
(71, 71, 'brands', ' Сплит-системы Centek отличное бюджетное решение в индустрии климатического оборудования.  Кондиционеры бренда Centek производят с внедрением передовых функций.', 0, 1),
(72, 72, 'brands', 'Китайская марка-крупный производитель систем кондиционирования Сплит-системы Cooper&amp;Hunter- это современное оборудование, которое отвечает всем требованиям безопасности и качес', 0, 5),
(73, 73, 'brands', ' Климатическое оборудование Electrolux- качественные, произведенные в ногу со временем системы кондиционирования воздуха.', 0, 7),
(74, 74, 'brands', 'Производство сплит-систем из экологически чистых материалов. Кондиционеры Energolux сочетают в себе высокое качество и уникальный дизайн. ', 0, 8),
(75, 75, 'brands', ' Системы кондиционирования Fujitsu оснащены передовой технологией интеллектуальной диагностики и управления.', 0, 4),
(76, 76, 'brands', 'Сплит-системы Green оборудование высокого качества отвечающее всем требованиям энергосбережения на сегодняшний день.', 0, 2),
(77, 77, 'brands', ' Средний сегмент на рынке климатического оборудования, но благадаря подходу инженеров компании и высококлассному контролю производства кондиционеров Haier в скором времени займут в', 0, 7),
(78, 78, 'brands', ' Сплит-системы Hisense- качество на долгие годы, современный дизайн, каждая линейка имеет большой набор функционала, что очень упрощает управление кондиционером в процессе создания', 0, 9),
(79, 79, 'brands', 'Кондиционеры Jax это гарантия благоприятного климата в любом помещении.', 0, 4),
(80, 80, 'brands', ' Системы кондиционирования Lessar это комплексный подход к производству.', 0, 3),
(81, 81, 'brands', ' Кондиционеры Mitsubishi Electric- Качество на века.  Высочайшей уровень и репутация нарабатывалась десятками лет.  Mitsubishi Electric- Японское качество. ', 0, 5),
(84, 84, 'brands', ' Кондиционеры Pioneer- практичное и надежное оборудование.', 0, 4),
(85, 85, 'brands', 'Производство оборудования систем кондиционирования QuattroClima осуществляется на лидирующих мировых площадках.', 0, 1),
(87, 87, 'brands', 'Доступная по цене климатическая техника с современным дизайном. Отличное качество, доступная цена,соответствие всем международным стандартам. ', 0, 2),
(89, 89, 'brands', ' Бренд систем кондиционирования Toshiba это международное призвание давно завоеванное на мировом рынке климатического оборудования. ', 0, 4),
(90, 90, 'brands', ' Качество-это основа профессиональной деятельности международной  марки мирового лидера в производстве систем кондиционирования, с соблюдением международных стандартов и контроля к', 0, 2),
(91, 91, 'brands', ' Кондиционеры Zanussi лучший вариант для создания подходящего микроклимата в Вашем доме и для Вашей семьи. ', 0, 5),
